import React from "react";
import { Header } from "./Header"
import "./styles.css";

const Main = () => {
  const handleOnClick = () => {
    window.open(
      "http://localhost:3000/agregar", "_blank");
  }

  return (
    <>
      <Header titulo='Mis Tareas' />
    </>
  );
};

export { Main };
